import React from "react";
import ReactDOM from "react-dom/client";
import './index.css';

const pizzaData = [
    {
        name: "Focaccia",
        ingredients: "Bread with italian olive oil and rosemary",
        price: 6,
        photoName: "pizzas/focaccia.jpg",
        soldOut: false,
    },
    {
        name: "Pizza Margherita",
        ingredients: "Tomato and mozarella",
        price: 10,
        photoName: "pizzas/margherita.jpg",
        soldOut: false,
    },
    {
        name: "Pizza Spinaci",
        ingredients: "Tomato, mozarella, spinach, and ricotta cheese",
        price: 12,
        photoName: "pizzas/spinaci.jpg",
        soldOut: false,
    },
    {
        name: "Pizza Funghi",
        ingredients: "Tomato, mozarella, mushrooms, and onion",
        price: 12,
        photoName: "pizzas/funghi.jpg",
        soldOut: false,
    },
    {
        name: "Pizza Salamino",
        ingredients: "Tomato, mozarella, and pepperoni",
        price: 15,
        photoName: "pizzas/salamino.jpg",
        soldOut: true,
    },
    {
        name: "Pizza Prosciutto",
        ingredients: "Tomato, mozarella, ham, aragula, and burrata cheese",
        price: 18,
        photoName: "pizzas/prosciutto.jpg",
        soldOut: false,
    },
];

function App() {
    return (
        <div className="container">
            <Header />
            <Menu />
            <Footer />
        </div>
    );
}

const Header = () => {
    return (
        <header className="header">
            <h1>Woodfire & Pizza Co.</h1>
        </header>
    )
}

const Menu = () => {
    const pizzas = pizzaData;
    const numPizzas = pizzas.length;

    if (numPizzas <= 0) {
        <p>We're still working on our menu. Please come back later :)</p>
    }
    return (
        <main className="menu">
            <h2>Our Menu</h2>
            {numPizzas > 0 ? (
                <>
                    <p>Authenic Italian cuisine. 6 creative dishes to choose from. All from our stone oven, all organic and delicious.</p>
                    <ul className="pizzas">
                        {pizzas.map((data) => <Pizza pizzaObject={data} />)}
                    </ul>
                </>
            ) : <p>We're still working on our menu. Please come back later :)</p>}
        </main>
    );
}

const Pizza = ({ pizzaObject }) => {
    console.log(pizzaObject);

    // if (pizzaObject.soldOut) return null;
    return (
        <li className={`pizza ${pizzaObject.soldOut ? 'sold-out' : ''}`}>
            <img src={pizzaObject.photoName} alt={pizzaObject.name} />
            <div>
                <h3>{pizzaObject.name}</h3>
                <p>{pizzaObject.ingredients}</p>
                <span>{pizzaObject.soldOut ? "SOLD OUT" : `$${pizzaObject.price}`}</span>
            </div>
        </li>
    )
}

const Footer = () => {
    const hour = new Date().getHours();
    const openHour = 12;
    const closeHour = 22;
    const isOpen = (openHour <= hour && hour <= closeHour);
    console.log(isOpen);

    return (
        <footer className="footer">
            {isOpen ? <Order closeHours={closeHour} openHour={openHour} /> : <p>We're happy to wecome you between {openHour}:00 and {closeHour}:00.</p>}
        </footer>
    )
}

const Order = ({ closeHour, openHour }) => {
    return (
        <div className="order">
            <p>We're open from {openHour}:00 until {closeHour}:00. Come visit us or order online.</p>
            <button className="btn">Order</button>
        </div>
    )
};

// React v18
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
